import axios from 'axios'

class GetCity {
    getCity(latitude, longitude) {
        var details = '';
        // var url = "https://us1.locationiq.com/v1/reverse.php?key=pk.7fac93c8830180317f175b81ab04ff63&lat=45.5161&lon=-122.6913&format=json"
        var url = "https://us1.locationiq.com/v1/reverse.php?key=pk.7fac93c8830180317f175b81ab04ff63&lat=" + 
        latitude.toString() + "&lon=" + longitude.toString() + "&format=json";
        axios.get(url).then((response) => {
            details = response
        })
        return details;
    }
}

export default new GetCity();
